syntax = "proto2";

package MMPro.micromsg;

import "SKBuiltinString_t.proto";

message MicroMsgResponseNew {
	required int32 _Ret = 1;
	required SKBuiltinString_t _ToUserName = 2;
	required uint32 _MsgId = 3;
	required uint32 _ClientMsgId = 4;
	required uint32 _CreateTime = 5;
	required uint32 _ServerTime = 6;
	required uint32 _Type = 7;
	optional uint64 _NewMsgId = 8;
}
